function loadPartSpace(url) {
    var webR = new WebResource(url)
    var node =  {name: webR.getURL().filename()}

    webR.getSubElements(1)
    node.children = webR.subDocuments
        .collect(function(ea) {
            return ea.getURL()
        })
        .select(function(ea) {
            return ea.filename().match(/\.json$/)
        })
        .collect(function(ea) {
            var node = {
                name: ea.filename().replace(/\.json$/, ""),
                url: ea
            }
            this.data.nodesByURL[ea] = node
            return node
        }.bind(this))

    node.children.pushAll(webR.subCollections.collect(function(ea) {
        return this.loadPartSpace(ea.getURL())
    }.bind(this)))


    return node
}

